  color: ${props => props.theme.accentColor};
`

function Coins () {
  return (
    <Container>
      <Header>
        <Title>코인</Title>
      </Header>
      <CoinsList>
        <Coin></Coin>
      </CoinsList>
    </Container>
  )
}

export default Coins
